description:
Category	All Girl, Girl-Girl, Latin, Lesbian

Director	Dana Vespoli
Starring	Kristina Rose, Raylene, Vicki Chase, Missy Martinez, Tia Cyrus, Lola Foxx, Raven Rocket, Ava Alvarez

In this sizzling installment of the popular Lesbian Beauties series, eight beautiful Latin girls heat up four vignettes with passionate, lesbian sex. Vicky Chase tries to get Raven Rockette in trouble with their boss, only to find that Raven is incredibly feisty! Recently dumped Nicki Delano gets a makeover from bartender Missy Martinez, who shows her a few sexy tricks. Stripper Lola Foxx seeks advice from her idol, Raylene, when she plans to hang up her G string for good, and discovers that Raylene has more than just advice to give her former colleague. Last but not least, uptight sorority sister Tia Cyrus gets more than she bargained for when she confronts her hard partying enemy Kristina Rose about her smoking. Each scene is filled with the passionate kissing, spicy lovemaking and earth shattering orgasms that make Sweetheart the leader in lesbian erotica!


